            <nav className="navbar navbar-light bg-light">
                <div className="container-fluid">
                    <a className="navbar-brand" href="#">My Cart <span>{this.props.totalCounters}</span></a>
                </div>
            </nav>
        );
    }
}

export default NavBar;
